/*eslint-disable*/

import { useEffect } from "react";
import Col from "react-bootstrap/esm/Col";
import Row from "react-bootstrap/esm/Row";
import { Chart } from "react-google-charts";

function ShowChart(props) {
  const data = [["Name", "Number"]];

  let count = 0;
  for (let i in props.result) {
    if (count == 10) {
      break;
    }
    data.push(props.result[i]);
    count++;
  }

  const options = {
    width: "100%",
    height: "100%",
    bar: { groupWidth: "80%" },
    legend: { position: "none" },
    titleTextStyle: {
      fontSize: 20,
    },
    vAxis: {
      textStyle: {
        fontSize: 16,
      },
    },
    hAxis: {
      textStyle: {
        fontSize: 14,
      },
    },
  };
  const chart = (
    <Chart
      chartType="BarChart"
      width="600px"
      height="500px"
      data={data}
      options={options}
    />
  );

  //차트 만들기
  useEffect(() => {});

  return (
    <Row>
      <Col>
        <h1>이름 통계</h1>
      </Col>
      <Col>{chart}</Col>
    </Row>
  );
}

export default ShowChart;
